import { AppBar, Divider, Icon, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container,
    Popper,
    Paper,
    Fade,
    Grow,
    CardMedia,
  } from "@mui/material";

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

function createData(name, calories, fat, carbs, protein) {
    return { skill, framework, devops, cloud, exp};
  }

  const rows = [
    createData('Undergoing AWS Associate Certificate', 'N', 'N', 'Y', "this website runs on AWS!"),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];

function MySkills(){
    return (
        <Container fixed
        sx={{
            bgcolor: "transparent",
            marginTop: '10vh',
            marginBottom: '10vh',
            textAlign: 'center',
        }}
        >
            <h1>Skills</h1>
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                    <TableHead>
                    <TableRow>
                        <TableCell> Skill </TableCell>
                        <TableCell align="right">FrameWork</TableCell>
                        <TableCell align="right">DevOps</TableCell>
                        <TableCell align="right">Cloud</TableCell>
                        <TableCell align="right">Experience</TableCell>
                    </TableRow>
                    </TableHead>
                    <TableBody>
                    {rows.map((row) => (
                        <TableRow
                        key={row.name}
                        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                        >
                        <TableCell component="th" scope="row">
                            {row.name}
                        </TableCell>
                        <TableCell align="right">{row.skill}</TableCell>
                        <TableCell align="right">{row.framework}</TableCell>
                        <TableCell align="right">{row.devops}</TableCell>
                        <TableCell align="right">{row.cloud}</TableCell>
                        </TableRow>
                    ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Container>
    );
};

export default MySkills;
